      """  Unique identifier for this row. The value is a GUID.  """  
      self.PartOptionAvailList:str = obj["PartOptionAvailList"]
      """  PartOptionAvailList  """  
      self.PartOptionSelList:str = obj["PartOptionSelList"]
      """  PartOptionSelList  """  
